mwmap = defaultdict(dict)


def split_special(k, p):
    return p, k[len(p):]


def get_map():
    for k, v in ac.items():
        if k.startswith('mw'):
            # there are several special cases
            if k.startswith('mwSteppedColorStyle'):
                prefix, name = split_special(k, 'mwSteppedColorStyle')
            elif k.startswith('mwSymbol'):
                prefix, name = split_special(k, 'mwSymbol')
            elif k.startswith('mwTraceStyle'):
                prefix, name = split_special(k, 'mwTraceStyle')
            elif k.startswith('mwScale'):
                prefix, name = split_special(k, 'mwScale')
            elif '_' in k:
                prefix, name = k.split('_', 1)
                mwmap[prefix][v] = name
            else:
                print('bad key', k)
    return mwmap

